ax = Math.max(...data.similarity_scores)\n                min = Math.min(...data.similarity_scores)\n                console.log(min)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * ((data.similarity_scores[i] - min) / (max-min)));\n                    col.push(fullColorHex(temp,temp,76))\n                }\n                data.color = col;\n            }\n            if(b === 5){ //Lengths\n                max = Math.max(...data.lengths)\n                for(i=0;i<len;++i) {\n                    temp =  Math.floor(255 * (1 - (data.lengths[i] / max)));\n                    col.push(fullColorHex(temp, temp, temp));\n                }\n                data.color = col;\n            }\n            if(b===6){ //GC\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.gc[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===7){ //ECAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.ecai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            if(b===8){ //CAI\n                var temp = 0\n                for(i=0;i<len;++i){\n                    temp =  Math.floor(255 * data.cai[i]);\n                    col.push(fullColorHex(52, temp, temp));\n                    }\n                source.data.color = col;\n            }\n            source.change.emit();\n            "},"id":"fa8608c3-fae6-4ad9-a099-e0b29d080b45","type":"CustomJS"},{"attributes":{"dimension":1,"plot":{"id":"63d80f16-4954-44c8-80e8-f5a33e010d4e","subtype":"Figure","type":"Plot"},"ticker":{"id":"88c7cff7-6ec2-4f61-962f-a1bd000cf51e","type":"BasicTicker"}},"id":"5bd499d8-0c94-4629-8f8f-c12aa498ddca","type":"Grid"},{"attributes"
